import Card from 'react-bootstrap/Card'
import React from 'react';

function MyProject() {
    return(
        <Card style={{ width: '50rem' }}>
        <Card.Img variant="top" src="https://images.unsplash.com/photo-1592210454359-9043f067919b?ixid=MXwxMjA3fDB8MHxzZWFyY2h8Mnx8d2VhdGhlcnxlbnwwfHwwfA%3D%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=700&q=60" wdith="400" height="200"/>
        <Card.Body>
          <Card.Title>Project Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the bulk of
            the card's content. <br/>
          </Card.Text>
          <Card.Link href="#">Repository Link</Card.Link>
          <Card.Link href="#">Deployed Link</Card.Link>
        </Card.Body>
      </Card>
    )
}

export default MyProject;
